BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "online_sales" (
	"Transaction ID"	INTEGER,
	"Date"	TEXT,
	"Product Category"	TEXT,
	"Product Name"	TEXT,
	"Units Sold"	INTEGER,
	"Unit Price"	REAL,
	"Amount"	REAL,
	"Region"	TEXT,
	"Payment Method"	TEXT,
	"Product ID"	TEXT,
	"Order ID"	INTEGER
);
CREATE VIEW daily_sales AS
SELECT
    Date,
    SUM(Amount) AS Total_Revenue,
    COUNT(DISTINCT "Order ID") AS Total_Orders
FROM online_sales
GROUP BY Date;
CREATE VIEW daily_sales1 AS
SELECT
    Date,
    SUM(Amount) AS Total_Revenue,
    COUNT(DISTINCT "Order ID") AS Total_Orders
FROM online_sales
GROUP BY Date;
COMMIT;
